SELECT MAX("lineorder"."lo_partkey") as agg_0, MAX("lineorder"."lo_extendedprice" + "lineorder"."lo_discount") as agg_1 FROM "dim_date" LEFT OUTER JOIN "lineorder" ON "dim_date"."d_datekey" = "lineorder"."lo_orderdate"  WHERE ("lineorder"."lo_shipmode" IN ('REG AIR', 'TRUCK', 'SHIP', 'RAIL') OR "lineorder"."lo_orderdate" >= 19924481) AND "lineorder"."lo_orderpriority" IN ('2-HIGH', '1-URGENT', '5-LOW') AND "lineorder"."lo_quantity" <= 24 AND "dim_date"."d_yearmonth" LIKE '%Mar1994%'